  `title` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '标题',
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '别名',
  `icon` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '图标',
  `path` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '路径',
  `permissions` varchar(2000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '权限',
  `component` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '组件',
  `redirect` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '重定向',
  `hidden` tinyint(1) NULL DEFAULT 0 COMMENT '隐藏',
  `type` int NULL DEFAULT NULL COMMENT '路由类型 0 模块 1 分组 2 模块内 3 tab栏内',
  `is_system` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是系统级别',
  `sort` int UNSIGNED NULL DEFAULT 0 COMMENT '排序（同级有效）',
  `status` int NULL DEFAULT 1 COMMENT '状态 1 启用 0 禁用',
  `ext_data` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '扩展数据',
  `remarks` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '备注',
  `source_module_id` bigint NULL DEFAULT NULL COMMENT '源模块 ID',
  `source_application_id` bigint NOT NULL COMMENT '源应用 ID',
  `application_id` bigint NOT NULL COMMENT '应用 ID',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `create_user_id` bigint NULL DEFAULT NULL COMMENT '创建人ID',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `wk_admin_router_application_id_index`(`application_id` ASC) USING BTREE,
  INDEX `router_id`(`router_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '全局路由配置表' ROW_FORMAT = DYNAMIC;

