DROP TABLE IF EXISTS `wk_call_record`;
CREATE TABLE `wk_call_record` (
  `call_record_id` bigint NOT NULL COMMENT '主键 记录id',
  `number` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '电话号码',
  `start_time` datetime DEFAULT NULL COMMENT '开始振铃时间',
  `answer_time` datetime DEFAULT NULL COMMENT '接通时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `talk_time` int DEFAULT '0' COMMENT '通话时长（秒）',
  `dial_time` int DEFAULT '0' COMMENT '摘机时长',
  `state` int DEFAULT NULL COMMENT '通话状态 (0未振铃，1未接通，2接通，3呼入未接通)',
  `type` int DEFAULT NULL COMMENT '通话类型 (0呼出，1呼入)',
  `model` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '关联模块 leads，customer，contacts',
  `model_id` bigint DEFAULT NULL COMMENT '关联模块ID',
  `file_path` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '录音文件路径',
  `task_status` int DEFAULT '1' COMMENT '定时任务状态',
  `size` int DEFAULT '0' COMMENT '录音文件大小',
  `file_name` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '文件名称',
  `call_upload` int DEFAULT '0' COMMENT '0：CRM服务器; 1：上传至阿里云',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user_id` bigint DEFAULT NULL COMMENT '创建人ID',
  `owner_user_id` bigint DEFAULT NULL COMMENT '负责人ID',
  `batch_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '批次',
  `update_user_id` bigint DEFAULT NULL COMMENT '修改人ID',
  `ident_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '通话标识',
  PRIMARY KEY (`call_record_id`) USING BTREE,
  KEY `start_time` (`start_time`) USING BTREE,
  KEY `create_time` (`create_time`) USING BTREE,
  KEY `owner_user_id` (`owner_user_id`) USING BTREE,
  KEY `model` (`model`,`model_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='通话记录';

-- ----------------------------
-- Table structure for wk_crm_achievement
-- ----------------------------
DROP TABLE IF EXISTS `wk_crm_achievement`;
CREATE TABLE `wk_crm_achievement`  (
  `achievement_id` bigint NOT NULL,
  `obj_id` bigint NULL DEFAULT NULL COMMENT '对象ID',
  `type` int NULL DEFAULT 0 COMMENT '1公司2部门3员工',
  `year` varchar(6) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '年',
  `january` decimal(18, 2) NULL DEFAULT 0.00 COMMENT '一月',
  `february` decimal(18, 2) NULL DEFAULT 0.00 COMMENT '二月',
  `march` decimal(18, 2) NULL DEFAULT 0.00 COMMENT '三月',
  `april` decimal(18, 2) NULL DEFAULT 0.00 COMMENT '四月',
  `may` decimal(18, 2) NULL DEFAULT 0.00 COMMENT '五月',
  `june` decimal(18, 2) NULL DEFAULT 0.00 COMMENT '六月',
  `july` decimal(18, 2) NULL DEFAULT 0.00 COMMENT '七月',
  `august` decimal(18, 2) NULL DEFAULT 0.00 COMMENT '八月',
  `september` decimal(18, 2) NULL DEFAULT 0.00 COMMENT '九月',
  `october` decimal(18, 2) NULL DEFAULT 0.00 COMMENT '十月',
  `november` decimal(18, 2) NULL DEFAULT 0.00 COMMENT '十一月',
  `december` decimal(18, 2) NULL DEFAULT 0.00 COMMENT '十二月',
  `status` int NULL DEFAULT NULL COMMENT '1销售（目标）2回款（目标）',
  `yeartarget` decimal(18, 2) NULL DEFAULT 0.00 COMMENT '年目标',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `create_user_id` bigint NOT NULL COMMENT '创建人ID',
  `update_time` datetime NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  PRIMARY KEY (`achievement_id`) USING BTREE,
  INDEX `obj_id`(`obj_id` ASC, `type` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '业绩目标' ROW_FORMAT = DYNAMIC;

