  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `trans_content` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '翻译内容',
  `trans_detail` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '翻译详情',
