-- ----------------------------
-- Table structure for wk_crm_activity
-- ----------------------------
DROP TABLE IF EXISTS `wk_crm_activity`;
CREATE TABLE `wk_crm_activity`  (
  `id` bigint NOT NULL COMMENT '主键id',
  `type` int NULL DEFAULT NULL COMMENT '活动类型 1 跟进记录 2 创建记录 3 商机阶段变更 4 外勤签到 5.通话记录',
  `category` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '跟进类型',
  `activity_id` bigint NULL DEFAULT NULL COMMENT '活动ID (冗余时是查询方)',
  `activity_type` int NOT NULL COMMENT '活动类型 1 线索 2 客户 3 联系人 4 产品 5 商机 6 合同 7回款 8日志 9审批 10日程 11任务 12 发邮件  (冗余数据时代表发送人类型)  ',
  `activity_type_id` bigint NULL DEFAULT NULL COMMENT '活动类型Id  (冗余时是业务数据)',
  `activity_type_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '活动类型名称',
  `content` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '活动内容',
  `next_time` datetime NULL DEFAULT NULL COMMENT '下次联系时间',
  `status` int NULL DEFAULT 1 COMMENT '0 删除 1 正常',
  `create_user_id` bigint NOT NULL COMMENT '创建人id',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `batch_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '批次id',
  `time_type` int NULL DEFAULT NULL COMMENT '时间类型，前端需要，后端无需业务处理',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `is_relation` int NULL DEFAULT 0 COMMENT '是否有关联数据   0 没有  1 有',
  `pid` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '冗余数据标记（同步删除使用）',
  `relation_data` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '冗余关联数据',
  `valid` int NULL DEFAULT NULL COMMENT '是否有效（0否 1是）',
  `team_member_ids` varchar(440) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '有效跟进人',
  `visit_plan_id` bigint NULL DEFAULT NULL COMMENT '拜访计划id',
  `remind_team_members` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '提醒团队成员ID',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `activity_type_id`(`activity_type_id` ASC, `activity_type` ASC) USING BTREE,
  INDEX `batch_id`(`batch_id` ASC) USING BTREE,
  INDEX `activity_id`(`activity_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'crm活动表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of wk_crm_activity
-- ----------------------------

