  `contract_id` bigint NOT NULL,
  `name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '合同名称',
  `customer_id` bigint NULL DEFAULT NULL COMMENT '客户ID',
  `business_id` bigint NULL DEFAULT NULL COMMENT '商机ID',
  `quotation_id` bigint NULL DEFAULT NULL COMMENT '报价单ID',
  `check_status` int NOT NULL DEFAULT 0 COMMENT '0待审核、1通过、2拒绝、3审核中 4:撤回 5 未提交 6 创建 7 已删除 8 作废',
  `examine_record_id` bigint NULL DEFAULT NULL COMMENT '审核记录ID',
  `order_date` datetime NULL DEFAULT NULL COMMENT '下单日期',
  `create_user_id` bigint NOT NULL COMMENT '创建人ID',
  `owner_user_id` bigint NULL DEFAULT NULL COMMENT '负责人ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `num` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '合同编号',
  `start_time` datetime NULL DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime NULL DEFAULT NULL COMMENT '结束时间',
  `money` decimal(21, 6) NULL DEFAULT NULL,
  `discount_rate` decimal(21, 6) NULL DEFAULT NULL COMMENT '整单折扣',
  `total_price` decimal(21, 6) NULL DEFAULT NULL COMMENT '产品总价',
  `types` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '合同类型',
  `payment_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '付款方式',
  `batch_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '批次 比如附件批次',
  `contacts_id` bigint NULL DEFAULT NULL COMMENT '客户签约人（联系人id）',
  `remark` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '备注',
  `company_user_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '公司签约人',
  `last_time` datetime NULL DEFAULT NULL COMMENT '最后跟进时间',
  `received_money` decimal(21, 6) NULL DEFAULT NULL,
  `unreceived_money` decimal(21, 6) NULL DEFAULT NULL,
  `invoiced_money` decimal(21, 6) NULL DEFAULT NULL,
  `un_invoiced_money` decimal(21, 6) NULL DEFAULT NULL,
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `contract_status` int NULL DEFAULT NULL COMMENT '合同状态，当check_status!=1时,此处=check_status,\r\n1正常2完成3中止4废除5冻结6休眠,0的话就是使用的自定义的',
  `show_type` int NOT NULL DEFAULT 1 COMMENT '1是置灰，2正常显示',
  `contract_status_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT 'contract_status对应的合同状态中文名称',
  `high_query_status_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '高级查询字段',
  `last_content` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '最后一条跟进记录',
  PRIMARY KEY (`contract_id`) USING BTREE,
  UNIQUE INDEX `batch_id`(`batch_id` ASC) USING BTREE,
  INDEX `owner_user_id`(`owner_user_id` ASC) USING BTREE,
  INDEX `customer_id`(`customer_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '合同表' ROW_FORMAT = DYNAMIC;

