  `batch_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '批次 比如附件批次',
  `status` int NULL DEFAULT 1 COMMENT '客户状态 1 正常 2锁定 3删除',
  `last_time` datetime NULL DEFAULT NULL COMMENT '最后跟进时间',
  `pool_time` datetime NULL DEFAULT NULL COMMENT '放入公海时间',
  `is_receive` int NULL DEFAULT NULL COMMENT '1 分配 2 领取',
  `last_content` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '最后一条跟进记录',
  `receive_time` datetime NULL DEFAULT NULL COMMENT '接收到客户时间',
  `pre_owner_user_id` bigint NULL DEFAULT NULL COMMENT '进入公海前负责人id',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `is_wx_user` int NULL DEFAULT 0 COMMENT '客户类型 0系统客户 1企微客户',
  `external_userid` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '企业微信外部联系人的userid',
  `scrm_customer_id` bigint NULL DEFAULT NULL COMMENT 'wk_scrm_customer表customer_id',
  `get_reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '公海领取理由',
  `remind_user_ids` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '提醒用户ID',
  PRIMARY KEY (`customer_id`) USING BTREE,
  UNIQUE INDEX `batch_id`(`batch_id` ASC) USING BTREE,
  INDEX `contacts_id`(`contacts_id` ASC) USING BTREE,
  INDEX `customer_name`(`customer_name` ASC) USING BTREE,
  INDEX `company_id`(`mobile` ASC) USING BTREE,
  INDEX `idx_owner_company`(`owner_user_id` ASC) USING BTREE,
  INDEX `idx_telephone_companyid_status`(`telephone` ASC, `status` ASC) USING BTREE,
  INDEX `idx_mobile_companyid_status`(`mobile` ASC, `status` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '客户表' ROW_FORMAT = DYNAMIC;

