  `user_ids` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '适用员工',
  `label` int NULL DEFAULT NULL COMMENT '关联业务对象 1 线索 2 客户 3 联系人 4 产品 5 商机 6 合同 7回款8.回款计划',
