  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`flow_id`) USING BTREE,
  INDEX `flow_init_id`(`flow_init_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '阶段流程主信息表' ROW_FORMAT = DYNAMIC;

