  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `batch_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '批次 比如附件批次',
  `is_receive` int NULL DEFAULT NULL COMMENT '1 分配',
  `last_time` datetime NULL DEFAULT NULL COMMENT '最后跟进时间',
  `last_content` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '最后一条跟进记录',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `status` int NULL DEFAULT 1 COMMENT '线索状态 1 正常 2锁定 3删除',
  `pool_time` datetime NULL DEFAULT NULL COMMENT '放入公海时间',
  `receive_time` datetime NULL DEFAULT NULL COMMENT '接收到线索时间',
  `pre_owner_user_id` bigint NULL DEFAULT NULL COMMENT '进入公海前负责人id',
  `transform_time` datetime NULL DEFAULT NULL COMMENT '转化时间',
  `get_reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '领取理由',
  PRIMARY KEY (`leads_id`) USING BTREE,
  UNIQUE INDEX `batch_id`(`batch_id` ASC) USING BTREE,
  INDEX `owner_user_id`(`owner_user_id` ASC) USING BTREE,
  INDEX `owner_company_id`(`owner_user_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '线索表' ROW_FORMAT = DYNAMIC;

