  `main_file_ids` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '首图id',
  `detail_file_ids` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL,
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '活动地址',
  `marketing_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '活动类型',
  `marketing_money` decimal(11, 2) NULL DEFAULT NULL COMMENT '活动金额',
  `relation_dept_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '关联部门id',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `is_need_child` int NULL DEFAULT 0 COMMENT '是否展示子级部门 0不需要 1 需要',
  `is_show_introduce` tinyint(1) NULL DEFAULT NULL COMMENT '是否开启市场活动介绍：1、是，0、否',
  `is_show_form` tinyint(1) NULL DEFAULT NULL COMMENT '是否开启表单填写：1、是，0、否',
