-- Table structure for wk_crm_marketing_field
-- ----------------------------
DROP TABLE IF EXISTS `wk_crm_marketing_field`;
CREATE TABLE `wk_crm_marketing_field`  (
  `field_id` bigint NOT NULL COMMENT '主键ID',
  `field_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '自定义字段英文标识',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '字段名称',
  `type` int NOT NULL DEFAULT 1 COMMENT '字段类型 1 单行文本 2 多行文本 3 单选 4日期 5 数字 6 小数 7 手机  8 文件 9 多选 10 人员 11 附件 12 部门 13 日期时间 14 邮箱 15客户 16 商机 17 联系人 18 地图 19 产品类型 20 合同 21 回款计划',
  `remark` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '字段说明',
  `input_tips` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '输入提示',
  `max_length` int NULL DEFAULT NULL COMMENT '最大长度',
  `default_value` varchar(5000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '默认值',
  `is_unique` int NULL DEFAULT 0 COMMENT '是否唯一 1 是 0 否',
  `is_null` int NULL DEFAULT 0 COMMENT '是否必填 1 是 0 否',
  `sorting` int NULL DEFAULT 1 COMMENT '排序 从小到大',
  `options` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '如果类型是选项，此处不能为空，多个选项以，隔开',
  `operating` int NULL DEFAULT 255 COMMENT '是否允许编辑',
  `is_hidden` int NOT NULL DEFAULT 0 COMMENT '是否隐藏  0不隐藏 1隐藏',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `form_id` bigint NULL DEFAULT NULL COMMENT '表单Id',
  `field_type` int NOT NULL DEFAULT 0 COMMENT '字段来源  0.自定义 1.原始固定 2原始字段但值存在扩展表中',
  `style_percent` int NULL DEFAULT 50 COMMENT '样式百分比%',
  `precisions` int NULL DEFAULT NULL COMMENT '精度，允许的最大小数位',
  `form_position` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '表单定位 坐标格式： 1,1',
  `max_num_restrict` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '限制的最大数值',
  `min_num_restrict` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '限制的最小数值',
  `form_assist_id` bigint NULL DEFAULT NULL COMMENT '表单辅助id，前端生成',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `create_user_id` bigint NOT NULL COMMENT '创建人ID',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `is_multi` tinyint NULL DEFAULT 1 COMMENT '是否多选（1是 0否）',
  `is_exam_type` tinyint(1) NULL DEFAULT 0 COMMENT '是否考试类型字段：0、否，1、是',
  `score` decimal(10, 2) NULL DEFAULT NULL COMMENT '题目分数',
  `answer` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '答案',
  `is_contain_answer_score` tinyint(1) NULL DEFAULT NULL COMMENT '是否包含答案即可得分：0、否，1、是',
  `is_sensitive_case` tinyint(1) NULL DEFAULT NULL COMMENT '是否区分大小写：0、否，1、是',
  `is_sensitive_symbol` tinyint(1) NULL DEFAULT NULL COMMENT '是否区分标点符号：0、否，1、是',
  `is_trim` tinyint(1) NULL DEFAULT NULL COMMENT '是否去掉前后空格：0、否，1、是',
  `transform_field_id` bigint NULL DEFAULT NULL COMMENT '转化线索客户字段ID',
  `is_photograph` tinyint(1) NULL DEFAULT NULL COMMENT '是否限制拍照 1 是 0 否',
  PRIMARY KEY (`field_id`) USING BTREE
