-- ----------------------------
-- Table structure for wk_examine
-- ----------------------------
DROP TABLE IF EXISTS `wk_examine`;
CREATE TABLE `wk_examine`  (
  `examine_id` bigint UNSIGNED NOT NULL COMMENT '审批ID',
  `examine_init_id` bigint NULL DEFAULT NULL COMMENT '审批初始化Id',
  `label` bigint UNSIGNED NULL DEFAULT NULL COMMENT '0 OA 1 合同 2 回款 3发票 4薪资 5 采购审核 6采购退货审核 7销售审核 8 销售退货审核 9付款单审核10 回款单审核11盘点审核12调拨审核',
  `examine_icon` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '图标',
  `examine_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '审批名称',
  `recheck_type` int NULL DEFAULT NULL COMMENT '撤回之后重新审核操作 1 从第一层开始 2 从拒绝的层级开始',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `create_user_id` bigint NULL DEFAULT NULL COMMENT '创建人',
  `status` int NULL DEFAULT NULL COMMENT '1 正常 2 停用 3 删除 ',
  `batch_id` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '批次ID',
  `remarks` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '备注',
  `update_time` datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人',
  `user_ids` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '可见范围（员工）',
  `dept_ids` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '可见范围（部门）',
  `oa_type` int NULL DEFAULT 0 COMMENT '1 普通审批 2 请假审批 3 出差审批 4 加班审批 5 差旅报销 6 借款申请 0 自定义审批 7（不能删除的审批）',
  `group_id` bigint NULL DEFAULT NULL COMMENT '所属分组',
  `is_need_child` int NULL DEFAULT 0 COMMENT '是否展示子级部门 0不需要 1 需要',
  PRIMARY KEY (`examine_id`) USING BTREE,
  INDEX `wk_examine_init_id_index`(`examine_init_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '审批表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of wk_examine
-- ----------------------------

-- ----------------------------
-- Table structure for wk_examine_advanced_config
-- ----------------------------
DROP TABLE IF EXISTS `wk_examine_advanced_config`;
CREATE TABLE `wk_examine_advanced_config`  (
  `advanced_config_id` bigint NOT NULL COMMENT '高级配置id',
  `examine_id` bigint NULL DEFAULT NULL COMMENT '审批配置id',
  `node_handle_type` int NULL DEFAULT NULL COMMENT '异常处理类型1：自动同意2：转交给指定人员处理',
  `node_handle_user` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '转交指定处理人',
  `node_handle_role` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '转交指定角色',
  `node_handle_parent_level` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '转交指定上级',
  `repeat_handle_type` int NULL DEFAULT NULL COMMENT '当同一个审批人重复审批同一单据时处理类型1:仅首个节点需审批，其余自动同意2:仅连续审批时自动同意3:每个节点都需要审批',
  `reject_handle_type` int NULL DEFAULT NULL COMMENT '审批被拒后重新提交类型1：跳过审批流已通过的层级，返回拒绝的层级2：返回审批流初始层级',
  `modify_permission_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '修改权限类型0：都不选1：提交申请时，员工不可修改固定审批人2：提交申请时，员工不可删除固定抄送人\r\n',
  `limit_time_status` int NULL DEFAULT NULL COMMENT '是否开启限时配置:1是,0否',
  `create_user_id` bigint NULL DEFAULT NULL COMMENT '创建人',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '更新人',
  `create_time` datetime NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建日期',
  `update_time` datetime NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新日期',
  `batch_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '批次',
  `is_transferable` tinyint NULL DEFAULT 1 COMMENT '是否可转交 0 否 1 是',
  `is_consult` tinyint NULL DEFAULT 1 COMMENT '征求他人意见权限  0 否 1 是',
  `is_reject_choose_flow` tinyint(1) NULL DEFAULT 0 COMMENT '是否允许撤回时选择撤回到哪个节点',
  `is_create_user_withdraw` tinyint(1) NULL DEFAULT 1 COMMENT '是否允许创建人撤回',
  `privilege` int NULL DEFAULT 7 COMMENT '操作权限（十进制转二进制）',
  PRIMARY KEY (`advanced_config_id`) USING BTREE,
  UNIQUE INDEX `batch_id`(`batch_id` ASC) USING BTREE,
  UNIQUE INDEX `examine_id`(`examine_id` ASC) USING BTREE,
  INDEX `company_id`(`examine_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '审批高级配置表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of wk_examine_advanced_config
-- ----------------------------

-- ----------------------------
-- Table structure for wk_examine_advanced_config_limit_time
-- ----------------------------
DROP TABLE IF EXISTS `wk_examine_advanced_config_limit_time`;
CREATE TABLE `wk_examine_advanced_config_limit_time`  (
  `limit_time_handle_id` bigint NOT NULL COMMENT '限时处理id',
  `examine_id` bigint NULL DEFAULT NULL COMMENT '审核id',
  `advanced_config_id` bigint NULL DEFAULT NULL COMMENT '高级配置id',
