  `examine_type` int NULL DEFAULT NULL COMMENT '审批方式： 1 依次审批 2 会签 3 或签',
  `limit_time` double NULL DEFAULT NULL COMMENT '超多少时间自动处理',
  `limit_time_unit` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '超多少时间自动处理-单位:minute:分钟，hour小时，day天',
  `create_user_id` bigint NULL DEFAULT NULL COMMENT '创建人',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人',
  `create_time` datetime NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `batch_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '批次id',
  PRIMARY KEY (`limit_time_handle_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '审批高级配置-节点限时处理配置表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of wk_examine_advanced_config_limit_time
-- ----------------------------

