  `delegate_id` bigint NOT NULL,
  `delegate_user_id` bigint NOT NULL COMMENT '委托人',
  `number` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '委托编号',
  `trustee_user_id` bigint NOT NULL COMMENT '受托人',
  `labels` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '业务模块 0oa  1合同 2回款 3发票 4 薪资 5 采购审核 6采购退款审核 7 销售退款 9付款单退款审核 9 付款单审核 10回款单审核 11盘店审核 12调拨审核 20阶段审批',
  `start_time` datetime NOT NULL COMMENT '开始时间',
  `end_time` datetime NOT NULL COMMENT '结束时间',
  `state` tinyint NOT NULL COMMENT '是否启用 1 启用 0 禁用',
  `remarks` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '备注',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `create_user_id` bigint NOT NULL COMMENT '创建人ID',
  `update_time` datetime NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  PRIMARY KEY (`delegate_id`) USING BTREE,
  INDEX `create_user_id`(`create_user_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '审批委托表' ROW_FORMAT = DYNAMIC;

