  `type_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '请假类型',
  `money` decimal(18, 2) NULL DEFAULT NULL COMMENT '差旅、报销总金额',
  `start_time` datetime NULL DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime NULL DEFAULT NULL COMMENT '结束时间',
  `duration` decimal(18, 2) NULL DEFAULT NULL COMMENT '时长',
  `create_user_id` bigint NOT NULL COMMENT '创建人ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `batch_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '附件批次id',
  `examine_record_id` bigint NULL DEFAULT NULL COMMENT '审核记录ID',
  `examine_status` int NULL DEFAULT NULL COMMENT '审核状态 0 未审核 1 审核通过 2 审核拒绝 3 审核中 4 已撤回',
  `create_dept_id` bigint NULL DEFAULT NULL COMMENT '创建部门id',
  `last_handle_user_id` bigint NULL DEFAULT NULL COMMENT '最后处理人',
  `last_handle_time` datetime NULL DEFAULT NULL COMMENT '最后处理时间',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `examine_flag` int NULL DEFAULT 0 COMMENT '流程标识（详见examineFlagEnum）',
  `enclosure` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '附件',
  `submit_target` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '提交至',
  `classification` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '密级',
  `urgency` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '紧急程度',
  `handled` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '经办人',
  `telephone` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '联系电话',
  `submit_dept_id` bigint NULL DEFAULT NULL COMMENT '提交部门',
  `submit_time` datetime NULL DEFAULT CURRENT_TIMESTAMP COMMENT '提交时间',
  `application_reason_type` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '申请事由类型',
  `travelers` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '出行人',
  `examine_flow_data_draft` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL,
  PRIMARY KEY (`examine_id`) USING BTREE,
  INDEX `category_id`(`category_id` ASC) USING BTREE,
  INDEX `examine_record_id`(`examine_record_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '审批表' ROW_FORMAT = DYNAMIC;

