  `stay` decimal(18, 2) NULL DEFAULT NULL COMMENT '住宿费',
  `diet` decimal(18, 2) NULL DEFAULT NULL COMMENT '餐饮费',
  `other` decimal(18, 2) NULL DEFAULT NULL COMMENT '其他费用',
  `money` decimal(18, 2) NULL DEFAULT NULL COMMENT '金额',
  `vehicle` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '交通工具',
  `trip` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '单程往返（单程、往返）',
  `duration` decimal(18, 2) NULL DEFAULT NULL COMMENT '时长',
  `description` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '备注',
