  `config_id` bigint NULL DEFAULT NULL COMMENT '模板id',
  `status` int NOT NULL DEFAULT 1 COMMENT '状态 0停用 1启用',
  `member_user_id` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '需要提交的员工id，“,”分割',
  `type` int NULL DEFAULT NULL COMMENT '日志类型 1日报 2周报 3月报',
  `effective_day` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '每周需要统计的日期 1-6是周一到周六 7是周日',
  `start_day` int NULL DEFAULT NULL COMMENT '开始日期',
  `start_time` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '开始时间',
  `end_day` int NULL DEFAULT NULL COMMENT '结束日期',
