-- ----------------------------
-- Table structure for wk_oa_log_template_config
-- ----------------------------
DROP TABLE IF EXISTS `wk_oa_log_template_config`;
CREATE TABLE `wk_oa_log_template_config`  (
  `id` bigint NOT NULL COMMENT '主键',
  `system_flag` int NULL DEFAULT NULL COMMENT '是否自定义0否1是 ',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '模板名称',
  `template_icon` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '图标',
  `type` int NULL DEFAULT NULL COMMENT '模板类型 0不参与统计，1日报2周报3月报',
  `submit_type` int NOT NULL DEFAULT 0 COMMENT '提交类型 0不限制 1天 2周 3月',
  `submit_count` int NULL DEFAULT NULL COMMENT '提交数量',
  `status` int NULL DEFAULT NULL COMMENT '模板状态1 正常 2 停用 3 删除 ',
  `dept_ids` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '适用范围（部门）',
  `user_ids` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '适用范围（用户列表）',
  `limit_flag` int NULL DEFAULT 1 COMMENT '是否限制字数的开关：0不限制 默认1限制',
  `min` int NULL DEFAULT NULL COMMENT 'limitFlag == 1 时的最小值',
  `max` int NULL DEFAULT NULL COMMENT 'limitFlag == 1 时的最大值 ',
  `modify_flag` int NULL DEFAULT 0 COMMENT '填写后是否允许修改 ： 默认0能， 1不能',
  `delete_flag` int NULL DEFAULT NULL COMMENT '填写后是否允许删除：0不允许员工删除提交的日志；1仅允许删除24小时内提交的日志；2允许员工删除提交的日志',
  `send_dept_ids` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '默认发送部门',
  `send_user_ids` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '默认发送员工',
  `parent_levels` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '上级级别list',
  `custom_send` int NULL DEFAULT 0 COMMENT '自定义抄送开关：默认0未开启， 1开启',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '描述说明',
  `rule_status` int NULL DEFAULT NULL COMMENT '日志统计规则是否统计 默认0否，1是',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `create_user_id` bigint NULL DEFAULT NULL COMMENT '创建人',
  `update_time` datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人',
  `is_need_child` int NULL DEFAULT 0 COMMENT '是否展示子级部门 0不需要 1 需要',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '日志模板设置表' ROW_FORMAT = DYNAMIC;

