-- ----------------------------
-- Table structure for wk_work_task
-- ----------------------------
DROP TABLE IF EXISTS `wk_work_task`;
CREATE TABLE `wk_work_task`  (
  `task_id` bigint NOT NULL COMMENT '任务表',
  `name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '任务名称',
  `create_user_id` bigint NULL DEFAULT NULL COMMENT '创建人ID',
  `main_user_id` bigint NULL DEFAULT NULL COMMENT '负责人ID',
  `owner_user_id` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '团队成员ID',
  `create_time` datetime NULL DEFAULT NULL COMMENT '新建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `status` int NULL DEFAULT 1 COMMENT '完成状态 0未开始1正在进行2延期3归档 5结束',
  `class_id` bigint NULL DEFAULT -1 COMMENT '分类id',
  `label_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '标签 ,号拼接',
  `description` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '描述',
  `pid` bigint NULL DEFAULT 0 COMMENT '上级ID',
  `start_time` datetime NULL DEFAULT NULL COMMENT '开始时间',
  `stop_time` datetime NULL DEFAULT NULL COMMENT '结束时间',
  `priority` int NULL DEFAULT 0 COMMENT '优先级 从大到小 3高 2中 1低 0无',
  `work_id` bigint NULL DEFAULT 0 COMMENT '项目ID',
  `is_top` int NULL DEFAULT 0 COMMENT '工作台展示 0收件箱 1今天要做，2下一步要做，3以后要做',
  `is_open` int NULL DEFAULT 1 COMMENT '是否公开',
  `order_num` int NULL DEFAULT 999 COMMENT '排序ID',
  `top_order_num` int NULL DEFAULT 999 COMMENT '我的任务排序ID',
  `archive_time` datetime NULL DEFAULT NULL COMMENT '归档时间',
  `ishidden` int NULL DEFAULT 0 COMMENT '是否删除 0 未删除 1 删除',
  `hidden_time` datetime NULL DEFAULT NULL COMMENT '删除时间',
  `batch_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '批次',
  `is_archive` int NULL DEFAULT 0 COMMENT '1归档',
  `owner_dept_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '关联部门',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  PRIMARY KEY (`task_id`) USING BTREE,
  INDEX `company_id`(`create_user_id` ASC) USING BTREE,
  INDEX `main_user_id`(`main_user_id` ASC) USING BTREE,
  INDEX `pid`(`pid` ASC) USING BTREE,
  INDEX `work_id`(`work_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '任务表' ROW_FORMAT = DYNAMIC;

